import React from "react";
import { Link } from "react-router-dom";
import "../App.css";

const Home = () => {
  return (
    <div className="App">
      <header className="Background-Img1">
        <img
          src={process.env.PUBLIC_URL + "/resources/pik.png"}
          width="600"
          alt="poke"
        />
      </header>
      <center>
        <h1 color="blue">Poke App</h1>
        <Link to="/pokemons">Ver Pokemons</Link>
      </center>
    </div>
  );
};

export default Home;
